import React from 'react'
import "./Footer.css"

const Footer = () => {
    return (
        <div 
            className="footer d-flex justify-content-center align-items-center p-3 text-brown"
            style={{borderTop:"1px solid brown",fontFamily:"Garamond",fontSize:"30px"}}
        >
            <h5>“A book can give you an experience of someone’s life in a few hours, and this is far more profitable than any sale that’s going on.”</h5>
        </div>
    )
}

export default Footer
